Sleep disturbances are one of the most common symptoms of traumatic brain injury. 
Studies show that up to 65% of individuals suffering from traumatic brain injury have symptoms from sleep disturbances.

Sleep is extremely important as while sleeping the brain refreshes the connections that allow it to function and physically the body including muscles get the rest that is needed.

Some of the side effects of not getting sufficient sleep are:

ú Deepening depression and anxiety;

ú Loss of sense of well-being;

ú Lack of energy;

ú Increased irritability;

ú Increased fatigue;

ú Increased lack of cognition and concentration.

Traumatic brain injury causing sleep disturbances causing the above side effects greatly multiply the symptoms of traumatic brain injury.

Sleep disturbances that can occur following traumatic brain injury are as follows:

ú Insomnia-Difficulty falling asleep or staying asleep;

ú Excessive daytime sleepiness and drowsiness;

ú Mixing up sleep patterns;

ú Narcolepsy-Falling asleep uncontrollably during the day.

Traumatic brain injury can cause these sleep disturbances in many ways including:

ú An injured brain may not be able to tell the body to fall asleep or wake up due to chemical changes;

ú Loss of the brain's ability to control breathing causing sleep apnea;

ú Medications taken following the brain injury may cause problems going to sleep or staying asleep;

ú Sleeping during the day and physical inactivity;

ú Pain;

ú Depression.

Ways to improve sleep following traumatic brain injury:

ú Follow a schedule using an alarm to wake up the same time each day;

ú Get enough exercise and physical activity;

ú Avoid excessive napping during the day;

ú Avoid alcohol, nicotine and caffeine;

ú Review medications with your physician;

ú Transcranial light therapy-Studies have shown that light emitting diodes (LED) is a promising tool for neurorehabilitation. 
LED is a painless, non-thermal treatment that helps cellular function of injured brain cells.

